-- ----------------------------
DROP TABLE IF EXISTS `rescue_info`;
CREATE TABLE `rescue_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '救援ID',
  `code` varchar(255) DEFAULT NULL COMMENT '救援编码',
  `type` int(11) DEFAULT NULL COMMENT '救援类型\r\n1：火警救助',
  `casualty` tinyint(4) DEFAULT '0' COMMENT '有无人员伤亡\r\n0：无；1：有',
  `comburant` tinyint(4) DEFAULT '0' COMMENT '有无助燃物\r\n0：无；1：有',
  `status` int(11) DEFAULT '1' COMMENT '救援状态\r\n1：等待受理(默认)；\r\n2：已受理；\r\n3：等待救援；\r\n4：完成救援。',
  `province` int(11) DEFAULT NULL COMMENT '省',
  `city` int(11) DEFAULT NULL COMMENT '市',
  `area` int(11) DEFAULT NULL COMMENT '区',
  `street` int(11) DEFAULT NULL COMMENT '街道',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `address_cn` varchar(255) DEFAULT NULL COMMENT '完整的详细地址',
  `longitude` decimal(20,10) DEFAULT NULL COMMENT '地图用-经度',
  `latitude` decimal(20,10) DEFAULT NULL COMMENT '地图用-纬度',
  `user_id` int(11) NOT NULL COMMENT '登录者ID',
  `police_id` int(11) DEFAULT NULL COMMENT '救援队ID',
  `police_longitude` decimal(20,10) DEFAULT NULL COMMENT '救援队定位-经度',
  `police_latitude` decimal(20,10) DEFAULT NULL COMMENT '救援队定位-纬度',
  `alarm_person` varchar(255) DEFAULT NULL COMMENT '报警人',
  `alarm_phone` varchar(255) DEFAULT NULL COMMENT '报警人的电话号码',
  `voice_id` int(11) DEFAULT NULL COMMENT '语音资源ID',
  `voice_content` text COMMENT '语音翻译内容',
  `create_time` int(11) DEFAULT NULL COMMENT '救援发布时间',
  `update_time` int(11) DEFAULT NULL COMMENT '救援最后更新时间',
  `delete_time` int(11) DEFAULT NULL COMMENT '软删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='救援信息表';

